const Home = () => (
  <div className="container text-center">
    <div className="jumbotron mt-5">
      <h1 className="display-4">
        Welcome to <span className="fw-bold">GhorKuno</span>
      </h1>
      <p className="lead">This is an system with production level features!</p>
      <hr className="my-4" />
      <h1>Home for Worker</h1>
    </div>
  </div>
);

export default Home;
